import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Survey from './components/Survey';
import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/" component={Survey} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
